import React from 'react';
/** Import components */
import {
  Navbar,
  NavbarBrand,
  Button,
  Row,Col
} from 'reactstrap';
import { NavLink } from 'react-router-dom';

/** Import assets */
import logo from 'assets/images/logo.jpg';
import logoTesxtImage from 'assets/images/logo_text.png';
import './topNav.css';

class TopNav extends React.Component {
  handleLogoutClick(e) {
    this.props.authActions.logout();
  }
  render() {
    // const { name } = this.props.currentUser;
    return (
      <div style = {{display:"flex", flexDirection:"column"}}>
      <Row>
        <Col xs = {3}></Col>
        <Col xs = {6}>
          <img style = {{width:"100%"}} src = {logoTesxtImage}/>
        </Col>
        <Col xs = {3}></Col>
      </Row>
      <div className="top-nav">
        <Navbar light expand className="shadow-sm bg-white p-0 h-100">
          <NavbarBrand>
            <NavLink
              activeClassName="active"
              to={`/`}
            >
                 <img src={logo} alt="ChatMatic" className="top-nav-logo" />
            </NavLink>
          </NavbarBrand>
          <NavbarBrand>
            <NavLink
              activeClassName="active"
              to={`/home`}
            >
             <Button outline color="primary" size = "sm"><i className = "fa fa-home"></i>Home</Button>
            </NavLink>
          </NavbarBrand>
          <NavbarBrand >
            <NavLink
              activeClassName="active"
              to={`/exercise`}
            >
             <Button outline color="primary" size = "sm"><i className = "fa fa-home"></i> Exercise</Button>
             </NavLink>
          </NavbarBrand>
          <NavbarBrand>
            <NavLink
              activeClassName="active"
              to={`/food`}
            >
             <Button outline color="primary" size = "sm"><i className = "fa fa-home"></i> Food</Button>
             </NavLink>
          </NavbarBrand>
          <NavbarBrand >
            <NavLink
              activeClassName="active"
              to={`/supplements`}
            >
                <Button outline color="primary" size = "sm"><i className = "fa fa-home"></i> Supplements</Button>
             </NavLink>
          </NavbarBrand>
        </Navbar>
      </div>
      </div>
    );
  }
}

export default TopNav
